import classes from "../pages/work.module.css";
function SkillsBox(props) {
  return (
    <div className={classes.card}>
      <div class="box">
        <img src={props.img} />
        <h3>{props.title}</h3>
        <i class="fas fa-hand-point-up"></i>
        <p>{props.description}</p>
      </div>
    </div>
  );
}
export default SkillsBox;
